Tornillo Learning Community: We are excited to share very important news for the upcoming school year set to start Mon., Aug. 3rd. Parents have options to register children to attend school physically or online. Stay in the Know: https://youtube.com/watch?v=0Ml8WtDP_l4&feature=youtu.be #TISDProud
@smithmollyk

https://twitter.com/rvegab_TISD/status/1276650907275390976

Tornillo Learning Community, we are back at 9 active COVID cases in our community. We must do our part to stop the spread. PERSONAL RESPONSIBLE ACTION: STOP gathering, PRACTICE social distancing, WASH your hands often, WEAR a mask, and GET tested often! #TISDProud
@BobMooreNews

https://twitter.com/rvegab_TISD/status/1276935215143809024

Tornillo Learning Community: Testing is open to symptomatic and asymptomatic residents. To make an appointment visit http://TXCOVIDTest.org or call 512-883-2400. #TISDProud
@TISDHealthyPack

https://twitter.com/rvegab_TISD/status/1276534755958206465

